import { useEffect, useState } from 'react';
import styles from './main.module.css';
import TemplateList from '../FolderStructure/FolderStructure';
import OAuth from '../Auth/OAuth';

export default function Main() {
	function setSelectedTemplate(selectedTemplate) {
		setTemplate(selectedTemplate);
	}

	return (
		<>
			<div className={styles.taglineContainer}>
				<h1 className={styles.tagline}>DSX - Folder Templates</h1>
			</div>

			<div className={styles.controlsContainer}>
				<OAuth />

				<div className={styles.horizontalLine} />

				<TemplateList setSelectedTemplate={setSelectedTemplate} />
			</div>
		</>
	);
}
